// import {useState} from 'react'
import { useNavigate } from "react-router-dom";
import "./register.css";
import Button from "@material-ui/core/Button";
import style from "../../components/atoms/Button/buttonsStyles";
import Logo from "../../resources/img/logo_gather.png";
import { useState } from "react";
import ModalLoginReg from "../../components/molecules/Modal/ModalLoginReg";

const Register = () => {
  const [mostrarForm, setMostrarForm] = useState(false);

  let navigate = useNavigate();
  const showForm = () => {
    setMostrarForm(!mostrarForm);
    console.log("mostrar modal" + mostrarForm);
  };

  return (
    <>
      <div className="container-register container-fluid d-flex flex-column row">
        <div className="video-background">
        <iframe width="560" height="315" src="https://www.youtube.com/embed/abd6vXIudks?loop=1&autoplay=1&controls=0&disablekb=0&fs=0&modestbranding=0&rel=0&showInfo=1&autohide=1&playlist=abd6vXIudks" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
        </div>
        <div className="container-content">
          <div className="div-sup col-12 d-flex justify-content-end">
            <Button
              className="button btn-login my-4"
              variant="contained"
              style={style}
              onClick={() => {
                navigate("/home");
              }}
            >
              Ir a inicio
            </Button>
          </div>
          <div className="div-sup col-12 d-flex">
            <h3 className="text-center w-100">Interact with our communities</h3>
          </div>
          <div className="logo-register col-md-12 mt-5">
            <div className="logo">
              <img className="img-fluid" src={Logo} alt="" />
              <h1 className="name text-white">Gather</h1>
            </div>
          </div>
          <div className="button-form col-md-12 d-flex justify-content-center mt-5">
          <div class="box" onClick={showForm}>JOIN IN</div>
          </div>
        </div>
      </div>
      {mostrarForm ? (
        <ModalLoginReg
          show={mostrarForm}
          onHide={showForm}
        />
      ) : null}
    </>
  );
};

export default Register;
